import React from 'react';

const FinalStep = ({ formData, updateFormData, nextStep, prevStep }) => {
  const handleSubmit = () => {
    // Here you would typically handle the final submission
    // For now, we'll just move to the confirmation page
    nextStep();
  };

  return (
    <div>
      <h2>Final Step</h2>
      <p>Review your information:</p>
      {/* You can add a summary of the form data here */}
      <button onClick={prevStep}>Previous</button>
      <button onClick={handleSubmit}>Submit</button>
    </div>
  );
};

export default FinalStep;
